Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    import spark.implicits._

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.parallelize(Seq(
      ("query1", 1614979200),
      ("query2", 1614982800),
      ("query1", 1614986400),
      ("query3", 1614990000),
      ("query2", 1614993600),
      ("query1", 1614997200)
    )).toJavaRDD

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext.parallelize(Seq("query1", "query2")).toJavaRDD

    // Broadcast top frequent queries
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Calculate hit rate
    val hitRate = calculateHitRate(onsiteData, broadcastTopQueries)

    println(s"Hit rate: $hitRate")

    spark.stop()
  }

  def calculateHitRate(onsiteData: JavaRDD[(String, Long)], broadcastTopQueries: Broadcast[Array[String]]): Double = {
    val cache = mutable.Map[String, (Long, Int)]()

    val hits = onsiteData.mapPartitions(iter => {
      val topQueries = broadcastTopQueries.value
      iter.map { case (query, timestamp) =>
        if (topQueries.contains(query)) {
          val cacheEntry = cache.getOrElseUpdate(query, (timestamp, 0))
          if (timestamp - cacheEntry._1 <= 12 * 60 * 60) {
            cache(query) = (timestamp, cacheEntry._2 + 1)
            true
          } else {
            cache(query) = (timestamp, 1)
            false
          }
        } else {
          false
        }
      }
    }).filter(hit => hit).count()

    val totalQueries = onsiteData.count()

    hits.toDouble / totalQueries.toDouble
  }
}
```
This job first loads the onsite attributed data and top frequent queries. It then broadcasts the top frequent queries to all nodes in the cluster. The `calculateHitRate` function calculates the hit rate by iterating over the onsite attributed data and checking if the query is in the top frequent queries. If it is, it checks if the query is in the cache and if it's been less than 12 hours since it was last accessed. If it has, it increments the hit count and returns true. If it hasn't, it adds the query to the cache and returns false. The function then returns the hit rate by dividing the number of hits by the total number of queries.

